import { useEffect, useState, Suspense } from "react";

const CLASS_NAMES = [
  "airplane", "automobile", "bird", "cat", "deer",
  "dog", "frog", "horse", "ship", "truck"
];

function App() {
  const [categories, setCategories] = useState({});
  const [selectedImage, setSelectedImage] = useState(null);
  const [prediction, setPrediction] = useState(null);
  const [modelType, setModelType] = useState("cnn");
  const [visibleCategory, setVisibleCategory] = useState(null); // ðŸ”¥ ThÃªm state

  useEffect(() => {
    fetch("http://127.0.0.1:5000/categories")
      .then((res) => res.json())
      .then((data) => {
        const filteredData = {};
        CLASS_NAMES.forEach((className) => {
          if (data[className]) {
            filteredData[className] = data[className].slice(0, 5); // Táº£i trÆ°á»›c 5 áº£nh
          }
        });
        setCategories(filteredData);
      })
      .catch((err) => console.error("Error fetching categories:", err));
  }, []);

  const handlePredict = () => {
    if (!selectedImage) return;

    fetch("http://127.0.0.1:5000/predict", {
      method: "POST",
      headers: { "Content-Type": "application/json" },
      body: JSON.stringify({ image_url: selectedImage, model_type: modelType }),
    })
      .then((res) => res.json())
      .then((data) => setPrediction(data))
      .catch((err) => console.error("Error predicting:", err));
  };

  return (
    <div>
      <h1>CIFAR-10 Image Classifier</h1>

      <label>Select Model:</label>
      <select value={modelType} onChange={(e) => setModelType(e.target.value)}>
        <option value="cnn">CNN</option>
        <option value="resnet">ResNet</option>
        <option value="vgg">VGG</option>
      </select>

      {Object.keys(categories).length === 0 ? (
        <p>Loading images...</p>
      ) : (
        <Suspense fallback={<p>Loading images...</p>}>
          {CLASS_NAMES.map((category) => (
            <div key={category}>
              {/* Khi click vÃ o tÃªn folder, toggle hiá»ƒn thá»‹ áº£nh */}
              <h2
                onClick={() =>
                  setVisibleCategory(visibleCategory === category ? null : category)
                }
                style={{ cursor: "pointer", color: "blue" }}
              >
                {category}
              </h2>

              {/* Chá»‰ hiá»ƒn thá»‹ áº£nh náº¿u category Ä‘ang má»Ÿ */}
              {visibleCategory === category &&
                categories[category]?.map((img) => (
                  <img
                    key={img}
                    src={`http://127.0.0.1:5000/image/${category}/${img}`}
                    alt={img}
                    width={100}
                    loading="lazy" // âš¡ Lazy Loading
                    style={{ cursor: "pointer", margin: 5 }}
                    onClick={() =>
                      setSelectedImage(`http://127.0.0.1:5000/image/${category}/${img}`)
                    }
                  />
                ))}
            </div>
          ))}
        </Suspense>
      )}

      {selectedImage && (
        <div>
          <h2>Selected Image</h2>
          <img src={selectedImage} alt="Selected" width={200} />
          <button onClick={handlePredict}>Predict</button>
        </div>
      )}

      {prediction && (
        <div>
          <h2>Prediction Result</h2>
          <p>Class: <strong>{prediction.class_name}</strong></p>
          <p>Confidence: <strong>{(prediction.confidence * 100).toFixed(2)}%</strong></p>
        </div>
      )}
    </div>
  );
}

export default App;
